import React from 'react';

import {
  Container,
  DropdownInput,
  DatalistContainer,
  DropdownOption,
} from './styles';

interface Props {
  title: string;
  placeholder?: string | undefined;
  width?: number;
  onChange?: (event: React.ChangeEvent) => void;
  onBlur?: (event: React.FocusEvent) => void;
  value?: string;
  errorMessage?: string;
}

const InputDropdown: React.FC<Props> = ({ width }) => {
  return (
    <Container width={width}>
      <DropdownInput type="text" list="cities" />
      <DatalistContainer id="cities">
        <DropdownOption value="boston">Boston</DropdownOption>
        <DropdownOption value="new york">New</DropdownOption>
      </DatalistContainer>
    </Container>
  );
};

export default InputDropdown;
